#include "stdio.h"

float getSeriesElement(int n);
float powf(float base, int power);
float fabs(float x);

int main ()
{
    float returned = 0;
    int n = 1;
    float currentElement;
    float Îµ;


    printf("Enter epsilon value:");
    if (scanf("%f", &Îµ) != 1){ printf("Error: Wrong value for epsilon"); return 1;}

    currentElement = getSeriesElement(n);
    while (fabs(currentElement) > Îµ)
    {
        returned += currentElement;

        n++;
        currentElement = getSeriesElement(n);
    }

    printf("Sum of series (epsilon = %f) is %.2f", Îµ, returned);
    return 0;
}

float getSeriesElement(int n) {
    return n / powf(n+1, 2);
}


